webpackJsonp([0xe1743977a4e6],{391:function(e,t){e.exports={data:{markdownRemark:{html:'<h3>üëã everyone,</h3>\n<h1>Hello Again</h1>\n<p>Just a quick update on progress here at TinyMerch. We‚Äôve been hard at work this\npast week building out a lot of the nitty-gritty innards that\'ll make TinyMerch\nfunction. Stuff like setting up Firebase functions, generating print files,\nconnecting with APIs, etc, etc. üò¥</p>\n<p>Anyways, on to a couple of the more exciting aspects of TinyMerch. We\'ll be\nspinning up a TinyMerch Blog (Launching next week!) where we‚Äôll be regularly\nposting updates, along with helpful tips on setting up your store. We‚Äôve also\nbeen working on rounding out our Product Catalog for the Hackathon Launch. We‚Äôre\ncurrently looking to launch with shirts, prints, and digital files. But what are\nsome things you‚Äôd like to see? Let us know in the survey below!</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/product-94eaf0d06c1efcdb1218dbd785570885-8189c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 63.315217391304344%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Product Example"\n        title=""\n        src="/static/product-94eaf0d06c1efcdb1218dbd785570885-fb8a0.png"\n        srcset="/static/product-94eaf0d06c1efcdb1218dbd785570885-1a291.png 148w,\n/static/product-94eaf0d06c1efcdb1218dbd785570885-2bc4a.png 295w,\n/static/product-94eaf0d06c1efcdb1218dbd785570885-fb8a0.png 590w,\n/static/product-94eaf0d06c1efcdb1218dbd785570885-8189c.png 736w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Another exciting announcement we‚Äôd like to share is that TinyMerch will allow\nsellers to donate their proceeds to charity! With the holidays coming up and\nmany people in need around the world, we created a simple and easy outlet to\nallow content creators and businesses to donate to select charities with the\nclick of a button. As we finish setting this up, we\'d love to hear from you all\nabout which charities you\'d wish to see available for donations.</p>\n<p>(And for the less benevolent amongst you. . .The answer is yes, our accountant\nhas said this would most likely be deductible.)</p>\n<h3>Feedback Survey:</h3>\n<p><a href="https://goo.gl/forms/t8K8xDOgWTOry5Ew1">https://goo.gl/forms/t8K8xDOgWTOry5Ew1</a></p>\n<p>Interested in getting these updates in your inbox?\n(<a href="https://www.producthunt.com/upcoming/tiny-merch">Sign Up for Our Newsletter</a>)</p>\n<p>‚úåÔ∏è Best, The TinyMerch Team</p>',frontmatter:{date:"November 17, 2017",path:"/blog/upcoming-02",title:"Tiny Update #02"}}},pathContext:{prev:{html:"<h3>üëã everyone,</h3>\n<h1>Donating with TinyMerch</h1>\n<p>When we were building TinyMerch, our goal was to make selling physical products\non your website as quick and easy as possible. We wanted the barrier to entry to\nbe nonexistent, anyone with a site could sell merch directly to visitors.</p>\n<p>For many people, this creates a revenue stream that requires no effort on their\npart to maintain or operate. That's an incredibly exciting statement to make,\nand not many companies get to use a statement like that in their marketing. But\nthere was one piece of advice we received early on that seemed so perfect we\ncouldn't help but try and implement it. That feedback was to add an option to\ndonate profits to charity!</p>\n<p>This advice felt like a no-brainer. It allows people to quickly set up a\nfundraiser and start raising money, not just for themselves, but as a way of\nhelping others.</p>\n<p>So to start, we're offering the option to donate profits to ricebowls. An\namazing non-profit based in our own beautiful Greenville, SC. Ricebowls works to\nprovide food to orphanges around the world.</p>\n<p>We're actively working to add more charities to this list all the time! If\nthere's a charity you'd like to see on this list,\n<a href=\"mailto:team@tinymerch.com\">let us know</a>, and we'll do our best to continue and\nexpand our options.</p>\n<p>Interested in getting these updates in your inbox?\n(<a href=\"https://www.producthunt.com/upcoming/tiny-merch\">Sign Up for Our Newsletter</a>)</p>\n<p>‚úåÔ∏è Best, The TinyMerch Team</p>",id:"/Users/aeryk/Sites/Nicer/TinyMerch/tinymerch/website/src/pages/11-29-2017-donations/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2017-11-29",path:"/blog/donations",tags:["third"],title:"Giving Back Made Simplier",postTitle:"Giving Back",postGreeting:"üëã everyone,",postPreview:"When we were building TinyMerch, our goal was to make selling physical products on your website as quick and easy as possible. We wanted the barrier to entry to be nonexistent, anyone with a site could sell merch directly to visitors.\nFor many people, this creates a revenue stream that requires no effort on their part to maintain or operate.  That's an incredibly exciting statement to make, and not many companies get to use a statement like that in their marketing. But there was one piece of advice we received. . ."}},next:{html:'<h3>üëã everyone,</h3>\n<h1>Meet TinyMerch</h1>\n<p>First off, thanks so much for your interest in TinyMerch! \u2028Our success is dependent on growing an energetic and \u2028creative community. We‚Äôre excited to share some more \u2028designs and details of our product with you. Hopefully \u2028this will get you excited and thinking about how you or \u2028your company could potentially use TinyMerch.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/store-0c817765535a95445170b67152688348-55533.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 573px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 45.026178010471206%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Store Example"\n        title=""\n        src="/static/store-0c817765535a95445170b67152688348-55533.png"\n        srcset="/static/store-0c817765535a95445170b67152688348-72350.png 148w,\n/static/store-0c817765535a95445170b67152688348-1ff2d.png 295w,\n/static/store-0c817765535a95445170b67152688348-55533.png 573w"\n        sizes="(max-width: 573px) 100vw, 573px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><em>with TinyMerch you get two unique ways to sell your merch, \u2028a standalone store, and an embeddable widget to add to your site.</em></p>\n<h3>How it Works:</h3>\n<p>Our goal is to allow anyone the capability to add a store \u2028to their website in a matter of minutes, and to sell \u2028branded content they designed or digital products they‚Äôve\u2028made. To do this you‚Äôll simply signup, and using our \u2028TinyMerch Designer you‚Äôll upload a logo or some of your \u2028artwork and voil√†, you‚Äôve created your first product which\u2028we‚Äôve automatically added to your store.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/designer-cb0681468d7725dac6900303d2037a69-9563a.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50.95168374816984%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Designer Flow"\n        title=""\n        src="/static/designer-cb0681468d7725dac6900303d2037a69-fb8a0.png"\n        srcset="/static/designer-cb0681468d7725dac6900303d2037a69-1a291.png 148w,\n/static/designer-cb0681468d7725dac6900303d2037a69-2bc4a.png 295w,\n/static/designer-cb0681468d7725dac6900303d2037a69-fb8a0.png 590w,\n/static/designer-cb0681468d7725dac6900303d2037a69-9563a.png 683w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>What\'s Next:</h3>\n<p>Our goal is to have entire flow automated and fully\nfunctioning by the end of next week. Afterwards we‚Äôll turn \u2028our focus to building out the store widget. \u2028\u2028We are currently on track to allow test stores by Nov 27th.</p>\n<p>Interested in getting these updates in your inbox?\n(<a href="https://www.producthunt.com/upcoming/tiny-merch">Sign Up for Our Newsletter</a>)</p>\n<p>‚úåÔ∏è Best,\nThe Tiny Team</p>',id:"/Users/aeryk/Sites/Nicer/TinyMerch/tinymerch/website/src/pages/11-13-2017-upcoming-01/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2017-11-13",path:"/blog/upcoming-01",tags:["first"],title:"Tiny Update #01",postTitle:"Meet TinyMerch",postGreeting:"üëã everyone,",postPreview:"First off, thanks so much for your interest in TinyMerch! \u2028Our success is dependent on growing an energetic and \u2028creative community. We‚Äôre excited to share some more \u2028designs and details of our product with you. Hopefully \u2028this will get you excited and thinking about. . ."}}}}}});
